import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import LoginContainer from "../components/LoginContainer"
import React from 'react'


function Login(){
    return(
        <>
        <Navbar/>
        <LoginContainer/>
        <Footer/>
        </>
    )
}

export default Login;
